import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import ListSubheader from '@material-ui/core/ListSubheader';
import IconButton from '@material-ui/core/IconButton';
import InfoIcon from '@material-ui/icons/Info';
import StoreButton from '../atoms/store-Button';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 1500,
    height: 'auto',
  },
  icon: {
    color: 'rgba(255, 255, 255, 0.54)',
  },
}));

export default function TitlebarGridList(props) {
  const classes = useStyles();
  const products = props["products"];
  if( products === undefined) return(<div></div>);

  return (
    <div className={classes.root}>
      <GridList cellHeight={280} className={classes.gridList} cols={3}>
        {products.map((product) => (
          <GridListTile key={product["productId"]}>
            <img src={product["imageurl"]} alt={product["productTitile"]} />
            <GridListTileBar
              title={product["productTitile"]}
              subtitle={<span>by: {product["description"]}</span>}
              subtitle={<span>Price: {product["price"]}</span>}
              actionIcon={
                <div>
                    <span>Rating: {product["rating"]}</span>
                    <StoreButton />
                    <label>Rating: {product["deliveryTime"]}</label>
                </div>
              }
            />
          </GridListTile>
        ))}
      </GridList>
    </div>
  );
}
